INSERT INTO articles VALUES(2,'Superman','Clark Kent','Superman is a fictional comic book superhero appearing in publications by DC Comics, widely considered to be an American cultural icon. Created by American writer Jerry Siegel and Canadian-born American artist Joe Shuster in 1932 while both were living in Cleveland, Ohio, and sold to Detective Comics, Inc. (later DC Comics) in 1938, the character first appeared in Action Comics #1 (June 1938) and subsequently appeared in various radio serials, television programs, films, newspaper strips, and video games. (from Wikipedia)','2018-01-26 06:42:00.041425',14,'2018-02-02 06:42:00.058812','2018-02-02 06:42:00.058812');
INSERT INTO articles VALUES(3,'Krypton','Clark Kent','Krypton is a fictional planet in the DC Comics universe, and the native world of the super-heroes Superman and, in some tellings, Supergirl and Krypto the Superdog. Krypton has been portrayed consistently as having been destroyed just after Superman''s flight from the planet, with exact details of its destruction varying by time period, writers and franchise. Kryptonians were the dominant people of Krypton. (from Wikipedia)','2018-01-05 06:42:00.061356',14,'2018-02-02 06:42:00.063367','2018-02-02 06:42:00.063367');
INSERT INTO articles VALUES(4,'Batman & Robin','Bruce Wayne','Batman is a fictional character created by the artist Bob Kane and writer Bill Finger. A comic book superhero, Batman first appeared in Detective Comics #27 (May 1939), and since then has appeared primarily in publications by DC Comics. Originally referred to as The Bat-Man and still referred to at times as The Batman, he is additionally known as The Caped Crusader, The Dark Knight, and the World''s Greatest Detective, among other titles. (from Wikipedia)','2018-01-19 06:42:00.066108',14,'2018-02-02 06:42:00.067649','2018-02-02 06:42:00.067649');
INSERT INTO articles VALUES(5,'Wonder Woman','Diana of Themyscira','Wonder Woman is a DC Comics superheroine created by William Moulton Marston. She first appeared in All Star Comics #8 (December 1941). The Wonder Woman title has been published by DC Comics almost continuously except for a brief hiatus in 1986. (from Wikipedia)','2017-12-22 06:42:00.069863',14,'2018-02-02 06:42:00.071360','2018-02-02 06:42:00.071360');
INSERT INTO articles VALUES(6,'Flash','Bart Allen','The Flash is a name shared by several fictional comic book superheroes from the DC Comics universe. Created by writer Gardner Fox and artist Harry Lampert, the original Flash first appeared in Flash Comics #1 (January 1940). (from Wikipedia)','2017-12-29 06:42:00.073408',14,'2018-02-02 06:42:00.074666','2018-02-02 06:42:00.074666');
INSERT INTO articles VALUES(7,'Splinter','Hamato Yoshi','Master Splinter, or simply Splinter, is a fictional character from the Teenage Mutant Ninja Turtles comics and all related media. (from Wikipedia)','2018-01-12 06:42:00.076588',14,'2018-02-02 06:42:00.077792','2018-02-02 06:42:00.077792');
